import React from 'react';
import './App.css';
import GenerateGarden from "./component/GenerateGarden";



function App() {
  return (
    <div className="App">
      <h1>My Emoji Garden</h1>
      <div className="Theme">
        Theme:
        <select id="dropdown">
          <option value="Plants">Plants (d√©fault)</option>
          <option value="Emoticones">Emoticones</option>
          <option value="Weather">Weather</option>
        </select>
      </div>
      <div className="Theme">
        Speed:
        <select id="dropdown">
          <option value="2">2 seconds</option>
          <option value="2">5 seconds</option>
          <option value="3">7 seconds</option>
          <option value="4">10 seconds</option>
        </select>
      </div>
      <GenerateGarden />
    </div>
  );
}

export default App;
